import React from 'react'
import OptionSelect from './OptionSelect'

export default function Select() {
  return (
    <div>
        <select name="pets" id="pet-select">
            {props.options.map(option => <OptionSelect value={option.value} text={option.text} />)}
        </select>
    </div>
  )
}
